        function icon(d) {
            var code;

            if (d.loading) {
                return options.iconMap['spinner'];
            }

            // ANDS Business Logic
            if (d.labels.has('party') && d.labels.has('group')) {
                return options.iconMap['group'];
            }
            if (d.labels.has('collection') && d.labels.has('software')) {
                return options.iconMap['software'];
            }

            // find first icon
            var iconable = d.labels.find(function(label, index) {
                return options.icons[d.labels[index]];
            });
            if (!iconable) iconable = d.labels[0];
            var index = d.labels.indexOf(iconable);

            if (options.iconMap && options.showIcons && options.icons) {
                if (options.icons[d.labels[index]] && options.iconMap[options.icons[d.labels[index]]]) {
                    code = options.iconMap[options.icons[d.labels[index]]];
                } else if (options.iconMap[d.labels[index]]) {
                    code = options.iconMap[d.labels[index]];
                } else if (options.icons[d.labels[index]]) {
                    code = options.icons[d.labels[index]];
                }
            }

            return code;
        }

        function fontAwesomeSVGs() {
            return {
                'user' : 'user-solid.svg',
                'software' : 'file-code-o.svg',
                'group,users': 'users-solid.svg',
                'collection': 'folder-open-solid.svg',
                'service' : 'wrench-solid.svg',
                'publication' : 'book-solid.svg',
                'website' : 'globe-solid.svg',
                'activity' : 'flask-solid.svg'
            };
        }


        function image(d) {
            var i, imagesForLabel, img, imgLevel, label, labelPropertyValue, property, value;

            if (options.images) {
                imagesForLabel = options.imageMap[d.labels[0]];

                if (imagesForLabel) {
                    imgLevel = 0;

                    for (i = 0; i < imagesForLabel.length; i++) {
                        labelPropertyValue = imagesForLabel[i].split('|');

                        switch (labelPropertyValue.length) {
                            case 3:
                                value = labelPropertyValue[2];
                            /* falls through */
                            case 2:
                                property = labelPropertyValue[1];
                            /* falls through */
                            case 1:
                                label = labelPropertyValue[0];
                        }

                        if (d.labels[0] === label &&
                            (!property || d.properties[property] !== undefined) &&
                            (!value || d.properties[property] === value)) {
                            if (labelPropertyValue.length > imgLevel) {
                                img = options.images[imagesForLabel[i]];
                                imgLevel = labelPropertyValue.length;
                            }
                        }
                    }
                }
            }

            return img;
        }

        function init(_selector, _options) {
            initIconMap();

            merge(options, _options);

            if (options.icons) {
                options.showIcons = true;
            }

            if (!options.minCollision) {
                options.minCollision = options.nodeRadius * 2;
            }

            initImageMap();

            selector = _selector;

            container = d3.select(selector);

            container.attr('class', 'neo4jd3')
                .html('');

            if (options.infoPanel) {
                info = appendInfoPanel(container);
            }

            appendGraph(container);

            simulation = initSimulation();

            if (options.neo4jData) {
                loadNeo4jData(options.neo4jData);
            } else if (options.neo4jDataUrl) {
                loadNeo4jDataFromUrl(options.neo4jDataUrl);

            } else {
                console.error('Error: both neo4jData and neo4jDataUrl are empty!');
            }
        }

        function initIconMap() {
            Object.keys(options.iconMap).forEach(function(key, index) {
                var keys = key.split(','),
                    value = options.iconMap[key];

                keys.forEach(function(key) {
                    options.iconMap[key] = value;
                });
            });
        }

        function initImageMap() {
            var key, keys, selector;

            for (key in options.images) {
                if (options.images.hasOwnProperty(key)) {
                    keys = key.split('|');

                    if (!options.imageMap[keys[0]]) {
                        options.imageMap[keys[0]] = [key];
                    } else {
                        options.imageMap[keys[0]].push(key);
                    }
                }
            }
        }

        function initSimulation() {
            var width = $(svg.node().parentElement).width() ? $(svg.node().parentElement).width() : 862; // hardcoded for ie
            var height = $(svg.node().parentElement).height() ? $(svg.node().parentElement).height() : 150;
            var simulation = d3.forceSimulation()
            // .velocityDecay(0.8)

                .force('collide', d3.forceCollide().radius(function(d) {
                    return options.minCollision;
                }).iterations(2))
                // .force('charge', d3.forceManyBody())
                .force('link', d3.forceLink().id(function(d) {
                    return d.id;
                }))
                // .force('x', d3.forceX().strength(0.002))
                // .force('y', d3.forceY().strength(0.002))
                .force('center', d3.forceCenter(width / 2, height / 2))
                .on('tick', function() {
                    tick();
                })
                .on('end', function() {
                    if (options.zoomFit && !justLoaded) {
                        justLoaded = true;
                        zoomFit(2);
                    }
                });

            return simulation;
        }

        function loadNeo4jData() {
            nodes = [];
            relationships = [];

            updateWithNeo4jData(options.neo4jData);
        }

        function loadNeo4jDataFromUrl(neo4jDataUrl) {
            nodes = [];
            relationships = [];
            if (options.onLoading) {
                options.onLoading();
            }
            d3.json(neo4jDataUrl, function(error, data) {

                if (options.onLoadComplete) {
                    options.onLoadComplete(data)
                }

                // if (error) {
                //     throw error;
                // }

                updateWithNeo4jData(data);

            });
        }

        function merge(target, source) {
            Object.keys(source).forEach(function(property) {
                target[property] = source[property];
            });
        }

        function neo4jDataToD3Data(data) {
            var graph = {
                nodes: [],
                relationships: []
            };

            data.results.forEach(function(result) {

                result.data.forEach(function(data) {
                    data.graph.nodes.forEach(function(node) {
                        if (!contains(graph.nodes, node.id)) {
                            graph.nodes.push(node);
                        }
                    });

                    data.graph.relationships.forEach(function(relationship) {
                        relationship.source = relationship.startNode;
                        relationship.target = relationship.endNode;
                        graph.relationships.push(relationship);
                    });

                    data.graph.relationships.sort(function(a, b) {
                        if (a.source > b.source) {
                            return 1;
                        } else if (a.source < b.source) {
                            return -1;
                        } else {
                            if (a.target > b.target) {
                                return 1;
                            }

                            if (a.target < b.target) {
                                return -1;
                            } else {
                                return 0;
                            }
                        }
                    });

                    for (var i = 0; i < data.graph.relationships.length; i++) {
                        if (i !== 0 && data.graph.relationships[i].source === data.graph.relationships[i-1].source && data.graph.relationships[i].target === data.graph.relationships[i-1].target) {
                            data.graph.relationships[i].linknum = data.graph.relationships[i - 1].linknum + 1;
                        } else {
                            data.graph.relationships[i].linknum = 1;
                        }
                    }
                });
            });

            return graph;
        }

        function randomD3Data(d, maxNodesToGenerate) {
            var data = {
                    nodes: [],
                    relationships: []
                },
                i,
                label,
                node,
                numNodes = (maxNodesToGenerate * Math.random() << 0) + 1,
                relationship,
                s = size();

            for (i = 0; i < numNodes; i++) {
                label = randomLabel();

                node = {
                    id: s.nodes + 1 + i,
                    labels: [label],
                    properties: {
                        random: label
                    },
                    x: d.x,
                    y: d.y
                };

                data.nodes[data.nodes.length] = node;

                relationship = {
                    id: s.relationships + 1 + i,
                    type: label.toUpperCase(),
                    startNode: d.id,
                    endNode: s.nodes + 1 + i,
                    properties: {
                        from: Date.now()
                    },
                    source: d.id,
                    target: s.nodes + 1 + i,
                    linknum: s.relationships + 1 + i
                };

                data.relationships[data.relationships.length] = relationship;
            }

            return data;
        }

        function randomLabel() {
            var icons = Object.keys(options.iconMap);
            return icons[icons.length * Math.random() << 0];
        }

        function rotate(cx, cy, x, y, angle) {
            var radians = (Math.PI / 180) * angle,
                cos = Math.cos(radians),
                sin = Math.sin(radians),
                nx = (cos * (x - cx)) + (sin * (y - cy)) + cx,
                ny = (cos * (y - cy)) - (sin * (x - cx)) + cy;

            return { x: nx, y: ny };
        }

        function rotatePoint(c, p, angle) {
            return rotate(c.x, c.y, p.x, p.y, angle);
        }

        function rotation(source, target) {
            return Math.atan2(target.y - source.y, target.x - source.x) * 180 / Math.PI;
        }

        function size() {
            return {
                nodes: nodes.length,
                relationships: relationships.length
            };
        }
